function mapListener() {
    $('[mapTo]').each(function() {
        let mapPoint = $(this).attr('mapPoint')
        var mapTo = $(this).attr('mapTo')
        if (mapPoint && mapPoint.length > 0) {
            if ($(window).width() < mapPoint) {
                $(this).appendTo(mapTo);
                $(this).removeAttr('mapTo')
            }
        } else {
            if ($(window).width() < 992) {
                $(this).appendTo(mapTo);
                $(this).removeAttr('mapTo')
            }
        }

    })


}
$(document).ready(function() {
    mapListener()
})
$(window).resize(function() {
    mapListener()
})




function minusQuantity() {
	$('.minus').each(function () {
		$(this).on('click', function () {
			let quantity = parseInt($(this).siblings('.quantity-number').attr('value'))
			if ($(this).siblings('.quantity-number').val() <= 0) {
				quantity = 0;
			} else {
				quantity = quantity - 1;
			}
			$(this).siblings('.quantity-number').attr('value', quantity)
		})
	})
}
function plusQuantity() {
	$('.plus').each(function () {
		$(this).on('click', function () {
			let quantity = parseInt($(this).siblings('.quantity-number').attr('value'))
			quantity = quantity + 1;
			$(this).siblings('.quantity-number').attr('value', quantity)
		})
	})
}
